Liivaprits on tuletõrje- ja päästevahend, mis on mõeldud tulekustutamiseks või tuleohu kõrvaldamiseks. See on üks kõige levinumaid tuletõrjevahendeid, mida kasutatakse nii kodu-, tööstus- kui ka päästeteenistustes.

# Kasutamine ja tööpõhimõte

Liivaprits on mõeldud peamiselt süttivate või põlevate tahkete ainete, näiteks puidu, paberi, riiete või mööbli, tulekustutamiseks. See on eriti efektiivne kustutamiseks, kus tuli on piiratud alal või kus tuleohu on suur.

Liivaprits töötab nii, et kustutusaine (liiv või spetsiaalne kustutusaine) paisatakse surve all tulele, katmaks selle pinnale täielikult. See takistab hapniku juurdepääsu tulele, mis on vajalik põlemiseks, ja seeläbi kustutab tule. Liivaprits võib olla ka varustatud spetsiaalsete kustutusainetega, mis on mõeldud eriliste tuleohu tüüpide jaoks, nagu näiteks elektroonikaseadmete või keemiliste ainete puhul.

Liivapritsi kasutamine on suhteliselt lihtne. Enne kasutamist tuleks veenduda, et prits on korralikus seisukorras, ja et kustutusaine on piisavalt täis. Kui tuli on leekides või laialdaselt levinud, tuleks hoiduda liivapritsi kasutamisest ja otsida abi päästeteenistustelt.

## Kustutamise tüübid

Liivapritsid on võimelised kustutama erinevaid tüüpi tuleohusid. Need võivad olla:

* A-tüüpi tuleohud: süttivad tahked ained, nagu puit, paber või riietus;
* B-tüüpi tuleohud: süttivad vedelikud või gaasid, nagu näiteks bensiin või propan;
* C-tüüpi tuleohud: süttivad elektri- või elektriseadmed;
* D-tüüpi tuleohud: süttivad metallid või metalliühendid.

## Turvalisus

Liivapritsi kasutamisel tuleks järgida turvalisuse reegleid. Enne kasutamist tuleks veenduda, et prits on korralikus seisukorras ning et kustutusaine on piisavalt täis. Kui tuli on leekides või laialdaselt levinud, tuleks hoiduda liivapritsi kasutamisest ja otsida abi päästeteenistustelt.

# Kuidas liivapritsi käsitseda

Liivapritsi käsitsedamine on lihtne, kuid tuleks järgida mõningaid ohutusnõudeid.

## Eelkontroll

Enne liivapritsi kasutamist tuleks teha eelkontroll. Selleks tuleks veenduda, et:

* prits on korralikus seisukorras;
* kustutusaine on piisavalt täis;
* prits on õigesti seadistatud;

## Kasutamine

Liivapritsi kasutamiseks tuleks järgida neid samme:

1. Hoidke pritsi koht vastu tuld;
2. Suruge käepidet, et kustutusaine paisatakse tulele;
3. Liikuge aeglaselt tulele lähemale, et kustutusaine jõuab tulele;
4. Kustutage tuli täielikult.

## Puhastamine

Pärast liivapritsi kasutamist tuleks teha puhastamine. Selleks tuleks:

* Koristada kustutusaine;
* Pesta pritsi osad;
* Kontrollida, et prits on korralikus seisukorras.

# Ajalugu

Liivapritsid on kasutusel olnud juba sajandeid. Esimesed liivapritsid olid lihtsad, käsitsi käivitavad seadmed, mis kasutasid liiva või teisi kustutusaineid tule kustutamiseks.

19. sajandil arendati liivapritsid edasi, kasutades surveallikaid ja kustutusaineid. See võimaldas kasutada liivapritse laiemalt, eriti tööstus- ja päästeteenistustes.

20. sajandil arendati liivapritsid veel edasi, kasutades spetsiaalsete kustutusaineid ja surveallikaid. See võimaldas kasutada liivapritse veelgi laiemalt, eriti päästeteenistustes.

Tänapäeval on liivapritsid üks kõige levinumaid tuletõrjevahendeid, mida kasutatakse nii kodu-, tööstus- kui ka päästeteenistustes.
